import React from "react";
import '../App.css';

function Mission() {
  return (
    <section id="mission" className="mission">
      <h2>Our Mission</h2>
      <p>
        To meet critical healthcare needs across the U.S. by serving as a trusted liaison 
        connecting international RNs with healthcare providers. We prioritize ethics, reliability, 
        and efficiency to provide top-notch professional candidates.
      </p>
    </section>
  );
}

export default Mission;
